Sea Wings Collection

Technology Documentary hosted by Ed Easton, published by Discovery Channel broadcasted as part of DC Wings series in 1995 - English narration &lt;a href=&quot;
http://docuwiki.net/images/4/40/Sea-Wings-Collection-Cover.jpg&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://docuwiki.net/images/4/40/Sea-Wings-Collection-Cover.jpg&lt;/a&gt;

Information
------------------------------

From the sea they strike -- the Navy's SEA WINGS. This collection focuses on America's Naval sea wing defense craft, which include the fastest fighters of the day. Aircraft seen in action include the F-8 Crusader, A-6 Intruder and F/A-18 Hornet, which carry the latest computer controlled missiles and radar-jamming equipment. These modern marvels are the gatekeepers of America's defense. 
Set out to sea with the F/A-18 Hornet, the historical TBM Avenger, and of course, the F-14 Tomcat, while providing the largest show-of-force the United States military has to offer.There is no such thing as a training mission for a carrier pilot. Every decision, every mission has life or death consequences. Prepare to earn your Sea Wings. 

Seawings Productions Inc. co-production with The Discovery Channel

5)  Hornet: The Killer Bee 
The F/A-18 Hornet replaced the F-4 Phantom II fighter and A-7 Corsair II light attack jet, and also replaced the A-6 Intruder as these aircraft were retired during the 1990s. This part looks back at the active duty of the McDonnell Douglas F/A-18, with footage from its activity in Operation Desert Storm in the Gulf. Included is also footage of its work in the Adriatic as it runs reconnaissance missions over Bosnia. Alongside this is a profile of the men and women who fly the Hornet.

